define({"topics" : [{"title":"Query Inbound Calls","shortdesc":"\n                  <p class=\"shortdesc\">Get detailed information like caller, callee, call status, etc. of the active inbound     calls of the PBX.</p>\n               ","id":"reference_a5v_rt2_gdb","href":"topic\/api_query_inbound_calls.html","menu": {"hasChildren":false,},"tocID":"reference_a5v_rt2_gdb-d46e24862","topics":[]},{"title":"Query Outbound Calls","shortdesc":"\n                  <p class=\"shortdesc\">Get detailed information like caller, callee, call status, etc. of all calls dialing     out via the trunks of the PBX.</p>\n               ","id":"reference_lpp_5t2_gdb","href":"topic\/api_query_outbound_calls.html","menu": {"hasChildren":false,},"tocID":"reference_lpp_5t2_gdb-d46e24931","topics":[]},{"title":"Make an Internal Call","shortdesc":"\n                  <p class=\"shortdesc\">Make an internal call between two extensions.</p>\n               ","id":"reference_vkj_v52_gdb","href":"topic\/api_make_an_internal_call.html","menu": {"hasChildren":false,},"tocID":"reference_vkj_v52_gdb-d46e25000","topics":[]},{"title":"Make an Outbound Call","shortdesc":"\n                  <p class=\"shortdesc\">Make an outbound call from an extension through a trunk of the PBX.</p>\n               ","id":"reference_idv_w52_gdb","href":"topic\/api_make_an_outbound_call.html","menu": {"hasChildren":false,},"tocID":"reference_idv_w52_gdb-d46e25069","topics":[]},{"title":"Disconnect an Extension&apos;s Call","shortdesc":"\n                  <p class=\"shortdesc\">Disconnect an ongoing call of a specific extension.</p>\n               ","id":"reference_tqd_wt2_gdb","href":"topic\/api_disconnect_an_extension_call.html","menu": {"hasChildren":false,},"tocID":"reference_tqd_wt2_gdb-d46e25138","topics":[]},{"title":"Disconnect an Inbound Call","shortdesc":"\n                  <p class=\"shortdesc\">Disconnect an active inbound call.</p>\n               ","id":"reference_igq_b52_gdb","href":"topic\/api_disconnect_an_inbound_call.html","menu": {"hasChildren":false,},"tocID":"reference_igq_b52_gdb-d46e25207","topics":[]},{"title":"Disconnect an Outbound Call","shortdesc":"\n                  <p class=\"shortdesc\">Disconnect an active outbound call.</p>\n               ","id":"reference_nbm_252_gdb","href":"topic\/api_disconnect_an_outbound_call.html","menu": {"hasChildren":false,},"tocID":"reference_nbm_252_gdb-d46e25276","topics":[]},{"title":"Hold a Call","shortdesc":"\n                  <p class=\"shortdesc\">Put an active call on hold.</p>\n               ","id":"reference_pqp_352_gdb","href":"topic\/api_hold_a_call.html","menu": {"hasChildren":false,},"tocID":"reference_pqp_352_gdb-d46e25345","topics":[]},{"title":"Resume a Held Call","shortdesc":"\n                  <p class=\"shortdesc\">Through this interface, developers can resume the held call.</p>\n               ","id":"reference_fyx_j52_gdb","href":"topic\/api_resume_a_held_call.html","menu": {"hasChildren":false,},"tocID":"reference_fyx_j52_gdb-d46e25414","topics":[]},{"title":"Mute an Extension","shortdesc":"\n                  <p class=\"shortdesc\">After muting an extension, other users could not hear the voice of the muted extension     user.</p>\n               ","id":"reference_cby_l52_gdb","href":"topic\/api_mute_an_extension.html","menu": {"hasChildren":false,},"tocID":"reference_cby_l52_gdb-d46e25483","topics":[]},{"title":"Unmute an Extension","shortdesc":"\n                  <p class=\"shortdesc\">Unmute a muted extension. </p>\n               ","id":"reference_myg_n52_gdb","href":"topic\/api_unmute_an_extension.html","menu": {"hasChildren":false,},"tocID":"reference_myg_n52_gdb-d46e25553","topics":[]},{"title":"Listen Monitor","shortdesc":"\n                  <p class=\"shortdesc\">Through this interface, an extension can monitor another extension&apos;s call in Listen     mode.</p>\n               ","id":"reference_t54_q52_gdb","href":"topic\/api_listen_monitor.html","menu": {"hasChildren":false,},"tocID":"reference_t54_q52_gdb-d46e25622","topics":[]},{"title":"Whisper Monitor","shortdesc":"\n                  <p class=\"shortdesc\">Through this interface, an extension can monitor another extension&apos;s call in Whisper     mode. As a result, the monitor and\n                     the monitored extension can talk to each other, but the other     party in the call can talk to the monitor.\n                  </p>\n               ","id":"reference_gzd_s52_gdb","href":"topic\/api_whisper_monitor.html","menu": {"hasChildren":false,},"tocID":"reference_gzd_s52_gdb-d46e25691","topics":[]},{"title":"Barge-in Monitor","shortdesc":"\n                  <p class=\"shortdesc\">Through this interface, an extension can barge in another extension&apos;s call. As a     result, all the three parties can talk\n                     to each other.\n                  </p>\n               ","id":"reference_g2n_t52_gdb","href":"topic\/api_barge-in_monitor.html","menu": {"hasChildren":false,},"tocID":"reference_g2n_t52_gdb-d46e25760","topics":[]},{"title":"Transfer Inbound Calls","shortdesc":"\n                  <p class=\"shortdesc\">Through this interface, an inbound call from the PBX&apos;s trunk can be transferred to an         extension, IVR, queue, ring\n                     group, or an external number.\n                  </p>\n               ","id":"reference_ymz_xpx_nfb","href":"topic\/api_transfer_inbound_calls.html","menu": {"hasChildren":false,},"tocID":"reference_ymz_xpx_nfb-d46e25829","topics":[]},{"title":"Transfer Outbound Calls","shortdesc":"\n                  <p class=\"shortdesc\">Through this interface, an outbound call from the PBX&apos;s trunk can be transferred to         an extension, IVR, queue, ring\n                     group, or an external number.\n                  </p>\n               ","id":"reference_aqt_fqx_nfb","href":"topic\/api_transfer_outbound_calls.html","menu": {"hasChildren":false,},"tocID":"reference_aqt_fqx_nfb-d46e25898","topics":[]},{"title":"Call an Extension via IVR","shortdesc":"\n                  <p class=\"shortdesc\">The PBX will call to an extension via IVR to play the voice alarm.</p>\n               ","id":"reference_rwt_kw2_gdb","href":"topic\/api_call_an_extension_via_ivr.html","menu": {"hasChildren":false,},"tocID":"reference_rwt_kw2_gdb-d46e25967","topics":[]},{"title":"Call an External Number via IVR","shortdesc":"\n                  <p class=\"shortdesc\">The PBX will call to an external number via IVR to play the voice alarm.</p>\n               ","id":"reference_qvw_mw2_gdb","href":"topic\/api_call_an_external_number_via_ivr.html","menu": {"hasChildren":false,},"tocID":"reference_qvw_mw2_gdb-d46e26036","topics":[]},{"title":"Auto Dial (Queue)","shortdesc":"\n                  <p class=\"shortdesc\">The PBX will dial contact number automatically, after the call is answered, the PBX     will initiate the call to the Queue\n                     agents.\n                  </p>\n               ","id":"reference_jgb_vx2_gdb","href":"topic\/api_auto_dial_queue.html","menu": {"hasChildren":false,},"tocID":"reference_jgb_vx2_gdb-d46e26105","topics":[]},{"title":"Auto Dial (Ring Group)","shortdesc":"\n                  <p class=\"shortdesc\">The PBX will dial contact number automatically, after the call is answered, the PBX     will initiate the call to the Ring\n                     Group members.\n                  </p>\n               ","id":"reference_mz2_zh2_hdb","href":"topic\/api_auto_dial_ringgroup.html","menu": {"hasChildren":false,},"tocID":"reference_mz2_zh2_hdb-d46e26174","topics":[]},{"title":"Call Back","shortdesc":"\n                  <p class=\"shortdesc\">Through this interface, the PBX will dial two external numbers consecutively, and the     two numbers could be connected with\n                     the PBX as the transit stop.\n                  </p>\n               ","id":"reference_ozd_dy2_gdb","href":"topic\/api_call_back.html","menu": {"hasChildren":false,},"tocID":"reference_ozd_dy2_gdb-d46e26243","topics":[]},{"title":"Control Inbound Calls","id":"reference_wrf_jy2_gdb","href":"topic\/api_control_inbound_calls.html","menu": {"hasChildren":false,},"tocID":"reference_wrf_jy2_gdb-d46e26313","next":"reference_wrf_jy2_gdb-d46e26313",}]});